import React from "react";
import CssBaseline from "@material-ui/core/CssBaseline";

import Container from "@material-ui/core/Container";
import { makeStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";
import "../../../../index.css";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(15),
    textAlign: "center",
    color: theme.palette.text.secondary,
  },
  content: {
    fontSize: "52px",
    fontFamily: "Manrope",
  },
  subcontent: {
    fontSize: "20px",
    fontFamily: "Manrope",
    fontWeight: 200,
  },
}));

export default function Headercontent() {
  const classes = useStyles();

  return (
    <React.Fragment>
      <CssBaseline />
      <Container maxWidth="2sm">
        <div className={classes.root}>
          <Grid container spacing={1}>
            <Grid item xs={12}>
              <h2 className={classes.content}>Personal Financial Manager</h2>
            </Grid>
            <Grid item xs={6}>
              <h2 className={classes.content}>Plan your financial goals.</h2>
              <h4 className={classes.subcontent}>
                Manage your investments and liabilities. With My Portfolio Home
                you can plan your short-term and long-term financial goals.
              </h4>
            </Grid>
            <Grid item xs={6}>
              <Paper className={classes.paper}>xs=6</Paper>
            </Grid>
            <Grid item xs={3}>
              <Paper className={classes.paper}>xs=3</Paper>
            </Grid>
            <Grid item xs={3}>
              <Paper className={classes.paper}>xs=3</Paper>
            </Grid>
            <Grid item xs={3}>
              <Paper className={classes.paper}>xs=3</Paper>
            </Grid>
            <Grid item xs={3}>
              <Paper className={classes.paper}>xs=3</Paper>
            </Grid>
          </Grid>
        </div>
      </Container>
    </React.Fragment>
  );
}
